import React, { useState } from 'react';
import Square from "./square"
import Lawn from "./lawn"

class BimBamJob extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      size: String(props.commands).split(/\r?\n/)[0],
    };

  }

  render() {
	   return (
      <div className="game">
  	   	 <span> Size {this.state.size} </span>
         <Lawn size= {this.state.size} /> 
      </div>
	   )
	}
}

export default BimBamJob
